import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import fb from 'firebase'
import VueClipboard from 'vue-clipboard2'

VueClipboard.config.autoSetContainer = true;// add this line
Vue.use(VueClipboard);

Vue.config.productionTip = false;

const config = {
  apiKey: "AIzaSyAWr372l0gzRQ_PH6e7GHUpnv5Z6c8bCHg",
  authDomain: "about-me-582c5.firebaseapp.com",
  databaseURL: "https://about-me-582c5.firebaseio.com",
  projectId: "about-me-582c5",
  storageBucket: "about-me-582c5.appspot.com",
  messagingSenderId: "920884952929",
};

fb.initializeApp(config);

 new Vue({
      el: '#app',
      store,
      router,
      components: { App },
      template: '<App/>'
    });
